import React from 'react'
import styled from "styled-components";
function Home() {

    return (
       <Container>
         <Title>Model S </Title>
          <Wrap>Order online for Touchless Delivery</Wrap>
          <ButtonGroup>
              <LeftButtoon>Custom Order</LeftButtoon>
              <RightButton>Existing Inventory</RightButton>
          </ButtonGroup>
       </Container>
    )
}

export default Home

const Container = styled.div `
  background-image:url('images/model-s.jpg');
  height:100vh;
  width:100%;
  background-size:cover;
  background-position:center;
  flex-wrap:nowrap;
  `
const Title = styled.h1`
   padding-top:100px ;
  text-align: center;
  border: transparent;
  font-size:50px ;
  font-weight:Bold;
  text-align:center ;
`
const Wrap = styled.h3 `
  padding-top:7px;
  font-size:20px;
  font-weight:200;
  font-family: 'Jost', sans-serif;
  text-align:center ;
  
`
 const ButtonGroup = styled.div `
   display: flex;
  justify-content:center;
  align-items: center;
  padding-top:100px;
  font-family: 'Jost', sans-serif;
 `
const LeftButtoon = styled.button `
   padding: 9px 60px 9px 60px ;
   font-size:15px ;  
   border-radius:50px;
   text-transform: uppercase;
`
const RightButton = styled.button `
  padding: 9px 60px 9px 60px ;
   font-size:15px ;
   border-radius:50px;
   background:#333;
   color:#fff;
   border :transparent;
   margin-left:10px ;
   text-transform: uppercase;
`
